import Card from '../UI/Card';
import MealItem from './MealItem/MealItem';
import classes from './AvailableMeals.module.css';

const DUMMY_MEALS = [
  {
    id: 'm1',
    name: 'Halo-halo, Philippines',
    description: 'A cup of multicoloured halo-halo is the perfect for a hot and sticky Philippine summer day.',
    price: 22.99,
  },
  {
    id: 'm2',
    name: 'Pulled pork, North Carolina, USA',
    description: 'BBQ is serious business in the south',
    price: 16.5,
  },
  {
    id: 'm3',
    name: 'Poutine, Quebec, Canada',
    description: 'The ultimate late-night snack, poutine is greasy, filling street food at its best.',
    price: 12.99,
  },
  {
    id: 'm4',
    name: 'Bhel puri, India',
    description: 'India has an immense variety of street snacks across the country, Mumbai is the place to try bhel puri',
    price: 18.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
